    <script>
        const history = [];
        document.querySelector('svg').addEventListener('click', (e) => {
            const el = e.target.closest('path, polygon, rect, circle, ellipse, g');
            if (el) {
                const id = el.id;
                const tag = el.tagName;
                const cls = el.getAttribute('class');
                const origId = el.getAttribute('data-original-id') || 'none';
                
                document.getElementById('el-id').innerText = `ID: ${id} (Orig: ${origId})`;
                document.getElementById('el-tag').innerText = `Tag: ${tag}`;
                document.getElementById('el-class').innerText = `Class: ${cls}`;
                
                // Highlight
                document.querySelectorAll('.highlight').forEach(h => h.classList.remove('highlight'));
                el.classList.add('highlight');
                
                // Log
                const log = `{ id: "${id}", tag: "${tag}", class: "${cls}", orig: "${origId}" }`;
                history.push(log);
                const item = document.createElement('div');
                item.className = 'log-item';
                item.innerText = log;
                item.onclick = () => {
                    document.querySelectorAll('.highlight').forEach(h => h.classList.remove('highlight'));
                    document.getElementById(id).classList.add('highlight');
                };
                document.getElementById('history').prepend(item);
                console.log(log);
            }
        });

        function copyHistory() {
            const text = history.join('\n');
            navigator.clipboard.writeText(text);
            alert('History copied to clipboard');
        }
    </script>
